import React from "react";
import Header from "./components/Header";
import About from "./components/About";
import Catalog from "./components/catalog/Catalog.js";

class App extends React.Component {
  constructor(props) {
      super(props)
      this.state = {
          items: [
              {
                  id: 1,
                  title: '',
                  desc: '',
                  category: '',
                  price: ''
              }
          ]
      };
  }
  render() {
      return (
          <div className="wrapper">
              <Header />
              <About />
              <Catalog />
          </div>
      );
  }
}

export default App;
